import logo from "../public/";
import "./App.css";

function Header() {
  return (
    <header>
      <nav className="nav">
        <img src="./react-logo.png" alt="React Logo" />
        <ul className="nav-items">
          <li>Pricing</li>
          <li>About</li>
          <li>Contact Us</li>
        </ul>
      </nav>
    </header>
  );
}
function H1() {
  return <h1>Fun Facts about React !</h1>;
}

function Content() {
  return (
    <div>
      <H1 />
      <ol>
        <li>Fuck Mark Zuckerberg</li>
        <li>Fuck Mark Zuckerberg</li>
        <li>Fuck Mark Zuckerberg</li>
        <li>Fuck Mark Zuckerberg</li>
        <li>Fuck Mark Zuckerberg</li>
        <li>Fuck Mark Zuckerberg</li>
      </ol>
    </div>
  );
}

function Footer() {
  return <footer>Mohamed Amir</footer>;
}

function Page() {
  return (
    <div>
      <Header />
      <Content />
      <Footer />
    </div>
  );
}


export default Page;
